selector_to_html = {"a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes del teclado<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Idioma del teclado<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Americano<a class=\"headerlink\" href=\"#american\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-11\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">C\u00f3digo 11<a class=\"headerlink\" href=\"#code-11\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id13\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#china-post\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Publicar en China<a class=\"headerlink\" href=\"#china-post\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id29\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#ean-13\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-13<a class=\"headerlink\" href=\"#ean-13\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Idioma del teclado<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Americano<a class=\"headerlink\" href=\"#american\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#upc-e\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-E<a class=\"headerlink\" href=\"#upc-e\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id9\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo continuo<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>El esc\u00e1ner funciona continuamente. Si el escaneo tiene \u00e9xito o el tiempo de escaneo excede el tiempo de trabajo \u00fanico, el escaneo actual termina. Si el tiempo excede el tiempo especificado, el siguiente escaneo se activa autom\u00e1ticamente.</p>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Symbolog\u00edas<a class=\"headerlink\" href=\"#symbologies\" title=\"Link to this heading\">#</a></h1><h2>Invertir Symbolog\u00edas<a class=\"headerlink\" href=\"#reverse-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#plessey-telepen\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Plessey/Telepen<a class=\"headerlink\" href=\"#plessey-telepen\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id34\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de autodetecci\u00f3n<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>En el modo de detecci\u00f3n autom\u00e1tica, el esc\u00e1ner detectar\u00e1 el brillo del entorno circundante. Cuando el brillo cambia, el escaneo se activa. El escaneo termina cuando el escaneo es exitoso o el tiempo de escaneo excede el tiempo de trabajo \u00fanico. Independientemente de si el \u00faltimo escaneo fue exitoso o fall\u00f3, se volver\u00e1 a detectar el brillo del entorno circundante.</p>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Obtener versi\u00f3n de Firmware<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#code-93\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">C\u00f3digo 93<a class=\"headerlink\" href=\"#code-93\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id17\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#interleaved-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Intervalado 2 de 5<a class=\"headerlink\" href=\"#interleaved-2-of-5\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id24\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#ean-8\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-8<a class=\"headerlink\" href=\"#ean-8\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#enable-disable\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de escaneo<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Modo lanzador de teclas<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Pulse el bot\u00f3n para activar el escaneo, y suelte el bot\u00f3n para finalizar la exploraci\u00f3n. El escaneo termina cuando el escaneo es exitoso o el tiempo de lectura excede el tiempo de lectura simple.</p>", "a[href=\"barcode.html#codabar\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codabar<a class=\"headerlink\" href=\"#codabar\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id12\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#matrix-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Matriz 2 de 5<a class=\"headerlink\" href=\"#matrix-2-of-5\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id28\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes de volumen<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><p>Escanea el c\u00f3digo de configuraci\u00f3n correspondiente para activar o desactivar el indicador de sonido del esc\u00e1ner</p>", "a[href=\"barcode.html#code-39\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">C\u00f3digo 39<a class=\"headerlink\" href=\"#code-39\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id14\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html#end-character-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configuraci\u00f3n de End Caracter<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>El car\u00e1cter final se a\u00f1ade despu\u00e9s de los datos decodificados en el formato de datos decodificados + car\u00e1cter final.</p>", "a[href=\"barcode.html#reverse-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Invertir Symbolog\u00edas<a class=\"headerlink\" href=\"#reverse-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html#duplicate-barcode-detection-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Duplicar configuraci\u00f3n de detecci\u00f3n de c\u00f3digo de barras<a class=\"headerlink\" href=\"#duplicate-barcode-detection-settings\" title=\"Link to this heading\">#</a></h2><h3>Desactivar<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#msi\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">MSI<a class=\"headerlink\" href=\"#msi\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id30\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#upc-a\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-A<a class=\"headerlink\" href=\"#upc-a\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id5\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#industrial-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Industrial 2 de 5<a class=\"headerlink\" href=\"#industrial-2-of-5\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id27\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-expanded-rss-expanded\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Barra de datos GS1 expandida (RSS expandido)<a class=\"headerlink\" href=\"#gs1-databar-expanded-rss-expanded\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id23\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Car\u00e1cter<a class=\"headerlink\" href=\"#character\" title=\"Link to this heading\">#</a></h1><h2>Configuraci\u00f3n de End Caracter<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>El car\u00e1cter final se a\u00f1ade despu\u00e9s de los datos decodificados en el formato de datos decodificados + car\u00e1cter final.</p>", "a[href=\"barcode.html#code-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">C\u00f3digo 128<a class=\"headerlink\" href=\"#code-128\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id19\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes del sistema<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Restaurar ajustes por defecto<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Cuando ocurre un error desconocido en el esc\u00e1ner, puede reiniciar el esc\u00e1ner restaurando la configuraci\u00f3n predeterminada.</p>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo lanzador de teclas<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Pulse el bot\u00f3n para activar el escaneo, y suelte el bot\u00f3n para finalizar la exploraci\u00f3n. El escaneo termina cuando el escaneo es exitoso o el tiempo de lectura excede el tiempo de lectura simple.</p>", "a[href=\"character.html#transmit-code-id-character\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Trassmit C\u00f3digo ID Car\u00e1cter<a class=\"headerlink\" href=\"#transmit-code-id-character\" title=\"Link to this heading\">#</a></h2><p>Un caracter de c\u00f3digo identifica el tipo de c\u00f3digo de un c\u00f3digo escaneado. Esto puede ser \u00fatil cuando se decodifica m\u00e1s de un tipo de c\u00f3digo. El caracter de c\u00f3digo ID se inserta entre el caracter de prefijo (si se selecciona) y el s\u00edmbolo decodificado.</p>", "a[href=\"#m1-wired-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Gu\u00eda de configuraci\u00f3n r\u00e1pida del esc\u00e1ner con cable <strong>M1</strong><a class=\"headerlink\" href=\"#m1-wired-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"barcode.html#gs1-databar-limited-rss-limited\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1 DataBar Limitado (RSS Limitado)<a class=\"headerlink\" href=\"#gs1-databar-limited-rss-limited\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id21\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-omnidirectional-rss-omnidirectional\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Barra de datos GS1 Omnidireccional (RSS Omnidireccional)<a class=\"headerlink\" href=\"#gs1-databar-omnidirectional-rss-omnidirectional\" title=\"Link to this heading\">#</a></h2><h3>Activar/Desactivar<a class=\"headerlink\" href=\"#id22\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Restaurar ajustes por defecto<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Cuando ocurre un error desconocido en el esc\u00e1ner, puede reiniciar el esc\u00e1ner restaurando la configuraci\u00f3n predeterminada.</p>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
